import './index.css'; 
import Logobar from './features/Logobar';
import Navbar from './features/Navbar';
import Body from './features/Body';
import { useEffect, useState } from 'react';



function App() {


  //Render once to set userId
  useEffect(() => {
    localStorage.setItem("selectionSoftwareProductDocumentId", "187");
  }, []); 

  // Shared state for average score
  const [avgScore, setAvgScore] = useState(0);




  return (
    <>
    <div> <Logobar /> </div>
    <div> <Navbar setAvgScore={setAvgScore}/> </div>
    <div> <Body avgScore={avgScore}/> </div>
    </>
  )
}

export default App;
